INSERT INTO `v1_433e3d66d98cb7dc1a8cd0d7bc944436980c95dda452c2dc7cd97a2bdb197017` VALUES (1, 1, 101, "ガーゴイル", 0, "高い物理攻撃力を宿し、強力な範囲攻撃を行うよう\nプログラムされたボスが現れる。", "剛力なる鳥像", 0);
